import { Component } from '@angular/core';

@Component({
  selector: 'app-gmal-discovery',
  templateUrl: './gmal-discovery.component.html',
  styleUrls: ['./gmal-discovery.component.css']
})
export class GmalDiscoveryComponent {

}
<section class="discovery">
    <div class="container">
        <div class="bg-img">
            <img src="../../../../assets/images/vision-discovery-img.png" alt="" class="w-100">
        </div>

        <div class="row">
            <div class="col-lg-6">
                <h2></h2>
            </div>
        </div>
    </div>
</section>
